De igyekszem folyamatosan seedelni!
Es egy koszonet mindig jol esik! Regisztralnod kell hozza,
de ha mar megtetted, akkor akar Te magad is megoszthatsz
dolgokat!
Az is jo lenne, ha valaki az egeszet letoltene es persze
seedelne is utana sokaig! Tapasztalatom szerint a visszaosz
tasban a Magyarok nem igazan jok! Ez az osszetartassal is
kapcsolatos lehet. Cafoljuk ezt meg! Hajra!
Persze ha valaki mazsolazni szeretne, csak rajta, de amit
letoltottel azzal is batran seedben maradhatsz, nem fog megszolni
erte senki.
